import React, { Component } from 'react';
import PropTypes from 'prop-types';

import './lead.css'

export default class Lead extends Component {

  render() {
    return (
      <div className='top-menu-lead'>
        {this.props.text}
      </div>
    )
  }
}

Lead.prototype = {
  text: PropTypes.string,
}
